import React from 'react';

const Home = () => {
    return (
      <a name="home">
        <main>
          <img src="myAvatar.png" alt="avatar" className="mainimage" />
          <br />
          <h1>Joe Yang</h1>
          <h3>Software Developer</h3>
        </main>
      </a>
    );
};

export default Home;
